# port: 7890
# socks-port: 7891
# redir-port: 7892
# tproxy-port: 7893
mixed-port: 7890
allow-lan: true
bind-address: "*"
mode: rule
log-level: info
external-controller: 127.0.0.1:9090

dns:
  enable: true
  # listen: 0.0.0.0:53
  ipv6: false

  default-nameserver:
    - 223.5.5.5
    - 119.29.29.29
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  use-hosts: true
  nameserver:
    - https://doh.pub/dns-query
    - https://dns.alidns.com/dns-query
  fallback:
    - https://doh.dns.sb/dns-query
    - https://dns.cloudflare.com/dns-query
    - https://dns.twnic.tw/dns-query
    - tls://8.8.4.4:853
  fallback-filter:
    geoip: true
    ipcidr:
      - 240.0.0.0/4
      - 0.0.0.0/32

proxies:

proxy-groups:
  - { name: "$app_name", type: select, proxies: ["⚡️自动选择", "🇺🇸 US", "🇭🇰 HK", "🇨🇳 TW", "🇸🇬 SG", "🇯🇵 JP", "🇰🇷 KR", "🏳️‍🌈 LM"] }
  - { name: "📫 Telegram", type: select, proxies: ["$app_name", "⚡️自动选择", "🇺🇸 US", "🇭🇰 HK", "🇨🇳 TW", "🇸🇬 SG", "🇯🇵 JP", "🇰🇷 KR", "🏳️‍🌈 LM"] }
  - { name: "🎀 YouTube", type: select, proxies: ["$app_name", "⚡️自动选择", "🇺🇸 US", "🇭🇰 HK", "🇨🇳 TW", "🇸🇬 SG", "🇯🇵 JP", "🇰🇷 KR", "🏳️‍🌈 LM"] }
  - { name: "🍟 流媒体", type: select, proxies: ["$app_name", "⚡️自动选择", "🇺🇸 US", "🇭🇰 HK", "🇨🇳 TW", "🇸🇬 SG", "🇯🇵 JP", "🇰🇷 KR", "🏳️‍🌈 LM"] }
  - { name: "🤖 OpenAI", type: select, proxies: ["$app_name", "⚡️自动选择", "🇺🇸 US", "🇭🇰 HK", "🇨🇳 TW", "🇸🇬 SG", "🇯🇵 JP", "🇰🇷 KR", "🏳️‍🌈 LM"] }
  - { name: "⚡️自动选择", type: url-test, proxies: [], url: "http://www.gstatic.com/generate_204", interval: 86400 }
  - { name: "👻故障转移", type: fallback, proxies: [], url: "http://www.gstatic.com/generate_204", interval: 7200 }
  - { name: "🇺🇸 US", type: url-test, proxies: [/美国/] }
  - { name: "🇭🇰 HK", type: url-test, proxies: [/香港/] }
  - { name: "🇨🇳 TW", type: url-test, proxies: [/台湾/] }
  - { name: "🇸🇬 SG", type: url-test, proxies: [/新加坡/] }
  - { name: "🇯🇵 JP", type: url-test, proxies: [/日本/] }  
  - { name: "🇰🇷 KR", type: url-test, proxies: [/韩国/] }
  - { name: "🏳️‍🌈 LM", type: select, proxies: [/加拿大/,/澳大利亚/,/英国/,/法国/,/德国/,/荷兰/,/意大利/,/阿联酋/,/巴西/,/印度/] }
  - { name: "🧬 直连", type: select, proxies: ["DIRECT"] }

